import UserInput from './UserInput'
import {useState} from 'react'
import compareword from './secret'

function App() {
  const [guess,setGuess] = useState('')
  let message = ''
  let result
  if(guess.trim()){
    message =  `Your guess: ${guess}`
    result = compareword(guess)
    console.log(result)
  }

  return (
    <div className="App">
        <UserInput onSubmit= {(word)=>setGuess(word)}/>
        {message}
        {<div>result</div>}
    </div>
  );
}

export default App;
